                //});
                jQuery('.prezipcodeText').rules('add', {
                    number: true
                });
                jQuery('.parzipcodeText').rules('add', {
                    number: true
                });

                if ($('form').valid()) {
                    //alert("Hello");
                    $($get("SaveContactInfo")).click();
                } else {
                    // alert("Error");
                    e.preventDefault();
                    return false;
                }
            });
        });
